:text: |
  Descendants of WILLIAMS, William and NELSON, Jane
  JWILLIAMS, William Leonard and WANKLYN, Sarah
  JWILLIAMS, Emily Jane and GRAY, Charles
  VGRAY, Agnes Sara and BLUNT, Hugh Roper
  JBLUNT, Richard Mark and LEE, Patricia Eileen
  BLUNT, Richard Mark and LEE, Patricia Eileen (cont...)
  Brandenham Manor, Bucks, once the home of Isaac Disraeli, father of Benjamin (see below under Williams,
  Emily Jane). He met Patricia in England and went with her to Australia. There he worked for
  International Computers and Tabulators as Training Manager in Sydney (1965-67) and since then they have
  lived in Perth where Richard worked for Golden Fleece Petroleum for eight years. He was made redundant
  when the company closed down in Australia.
  Richard is a member and past-president of the North Perth Probus Club.
  01> BLUNT, David Mark
  b 06.07.1967
  David b, at Sydney, NSW, Australia.
  David graduated BMechEng(Hons) from the University of Australia. He is currently a research
  engineer in the Airframes and Engines Division of the Aeronautical and Maritime Research Laboratory
  of the Department of Defence.
  02> BLUNT, Georgia Alison
  b 09.06.1969
  Georgia b. at Perth, Western Australia. She is a doctor of medicine at the University of Western
  Australia.
  04>' GRAY, Sydney Thomas m on 02.02.1926 to LANE, Doris Audrey
  b 04.04.1890 d 14.06.1947
  b ** ** 1903 d ** ** ****
  Sydney b. at Waiohika and d, at Gisborne.
  01> GRAY, Audrey Louisem on 29.01.1955 to HOLDSWORTH, John Chambers
  b 14.11.1933 d 17.03.1985
  b 04.08.1929
  Audrey b. at Otahuhu and m. and d. at Gisborne. John, slo Bernard John Holdsworth and Jean Black.
  Address: Waikohu, Te Karaka, Gisborne.
  01> HOLDSWORTH, Deborah Jean
  b 23.09.1955
  Deborah b. at Gisborne. Address: 10 Windsor Court, Moscow Road, London W2, England.
  Deborah was educated at Marsden College, Wellington. After graduating from the Wellington
  Polytechnic as a graphic designer she worked for two years as a graphic designer/ teacher before
  going overseas. She has combined 13 years in London with travelling, working and studying art
  related subjects. She is now working in the antiques field and paints portraits.
  02> HOLDSWORTH, William Bernard
  b 25.06.1957 d 09.06.1968
  03> HOLDSWORTH, Cynthia Amy m on 23.01.1982 to JURIE, Gerald Michael
  b 10.11.1959
  b 01.07.1959
  Cynthia b. at Gisborne. Gerald, s/o Andrew Gerald Jurie and Helen Mary Southworth, b, at
  Wellington. Address: 17 Myrtle Street, Lower Hutt.
  Cynthia is a secretary.
